import React from 'react'

function Task({title,description,deleTask,index}) {

  return (
    <div className="task">
        <div>
            <span>{title}</span>
            <p>{description}</p>
        </div>
        <button onClick={()=>{deleTask(index)}} >-</button>
    </div>
  )
}

export default Task
